import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'Ali';
    const loading = false;
    const showName = true;

    return (
      <div className="App">
        { loading ? <h3>Loading...</h3> : <h1>Hello { showName ?  name : null}!</h1>}
      </div>
    );
  }
}

export default App;
